export async function loadStrokeColorUpdater(engine, refresh = true) {
    await engine.addParticleUpdater("strokeColor", async (container) => {
        const { StrokeColorUpdater } = await import("./StrokeColorUpdater.js");
        return new StrokeColorUpdater(container);
    }, refresh);
}
